import React from 'react';
import {Row, Col, Card}  from 'react-bootstrap';

const List = (props) => {
  const { repos } = props;
  if (!repos || repos.length === 0) return <p>No repos, sorry</p>;
  return (

<Row className="m-0">
  {repos.map((repo) => {
    return (
      <Col xs={12} md={6} lg={3}>
        <Card key={repo.id}>
          <Card.Img variant="top" src={repo.img} />
          <Card.Body>
            <Card.Title>{repo.title}</Card.Title>
            <Card.Text>
              {repo.description}
            </Card.Text>
          </Card.Body>
        </Card>
      </Col>
    )
  })}
</Row>
  );
};
export default List;
